import React from "react";

function Post({ posts, loading }) {
  if (loading) {
    return <h2>loading...</h2>;
  }
  return (
    <ul className="list-group mb-4">
      {posts.map((item) => (
        <li key={item.id} className="list-group-item">
          {item.title}
        </li>
      ))}
    </ul>
  );
}

export default Post;
